css:
@namespace url(http://www.mozilla.org/keymaster/gatekeeper/there.is.only.xul);

#stylish-toolbar-button dropmarker {display: none !important;}
#stylish-toolbar-button, #stylish-panel {list-style-image: none !important;}

toolbar[iconsize="large"] #stylish-toolbar-button .toolbarbutton-icon {
width: 31px !important; height: 24px !important;
background-image: url(
data:image/png;base64,
) !important;
}

#stylish-toolbar-button .toolbarbutton-icon,
#stylish-panel .statusbarpanel-icon {
width: 18px !important; height: 14px !important;
background-image: url(
data:image/png;base64,
) !important;
}

toolbar[iconsize="large"] #stylish-toolbar-button[styles-applied~="site"] .toolbarbutton-icon {
background-image: url(
data:image/png;base64,
) !important;
}

#stylish-toolbar-button[styles-applied~="site"] .toolbarbutton-icon,
#stylish-panel[styles-applied~="site"] > .statusbarpanel-icon {
background-image: url(
data:image/png;base64,
) !important;}
